import React from 'react';
import './App.css';
import ReactDOM from 'react-dom';
import Que from './questions';
function App() {
  return (
    <div className="App">
      <h1>QUIZ GAME</h1>
      <h1>WHICH LEVEL OF DIFFICULTY DO YOU WANT TO CHOOSE?</h1>
      <p><button onClick={()=>question(1)}>EASY</button></p>
      <p><button onClick={()=>question(2)}>MEDIUM</button></p>
      <p><button onClick={()=>question(3)}>HARD</button></p>
    </div>
  );

}
function question(d)
{

  ReactDOM.render(<Que difficulty={d} />, document.getElementById('root'));
}

export default App;
